import React from "react";
import { useState, useEffect } from "react";
import { useDispatch, useSelector } from "react-redux"
import { Link } from "react-router-dom/cjs/react-router-dom";
import { useParams } from "react-router-dom/cjs/react-router-dom.min";
import { getBreedDetails } from "../../actions";



export default function BreedDetails(props) {

    const dispatch = useDispatch();
    const breedDetail = useSelector(state => state.breedDetail) 

    const { id } = useParams();

    useEffect(()=>{
        dispatch(getBreedDetails(id))
    }, []);
    console.log(breedDetail);
    console.log(breedDetail.name)
    console.log(breedDetail.temperament.length);

    return (
        <div>
            <h1>BREED: {breedDetail.name}</h1>
            <img src={breedDetail.img}/>
            <p>MIN WEIGHT: {breedDetail.weight_min}</p>
            <p>MAX WEIGHT: {breedDetail.weight_max}</p>
            <p>LIFE SPAN: {breedDetail.life_span}</p>
            <span>MIN HEIGHT: {breedDetail.height_min}</span>
            <p>MAX HEIGHT: {breedDetail.height_max}</p>
            <ul>
                {breedDetail.temperament?.map(t => {
                    <li>{t}</li>
                })}
            </ul>
        </div>
    )
}
